# ## Классификация задач машинного обучения и место в ней регрессии

# %% [markdown] id="ia4m4Q84sovU"
# Чтобы понять место регрессии в задачах машинного обучения необходимо вспомнить, что такое машинное обучение (machine learning).
#
# **Машинное обучение** — это процесс, в результате которого некая модель сначала обучается каким-то образом, а потом начинает выдавать результаты - предсказывать.
#
# Зачем мы начали с такого размытого, чрезвычайно обобщенного и абстрактного определения машинного обучения? А для того, чтобы сместить немного акценты от данных к целевой функции.
#
# Когда вы начинаете решать любую практическую задачу, крайне важно определить целевую функцию, договориться о том, как вы будете оценивать результаты. Выбор целевой функции полностью определяет всю дальнейшую работу, и даже в похожих задачах разные целевые функции могут привести к совершенно разным моделям.
#
# Например, было бы здорово «научить компьютер читать», но сначала нужно определить, что это, собственно, значит. Уметь правильно отвечать на вопросы по «прочитанному» тексту? Сделать синтаксический разбор предложения? Показать самые релевантные данному тексту статьи «Википедии»?
#
# **ВАЖНО**. Разные ответы приводят к разным моделям и направлениям исследований!!!
#
# Взгляните на рис. 1.  Два основных класса задач машинного обучения — это задачи обучения с учителем и обучения без учителя.

