# %% [markdown] id="FNQ68mAxvzCT"
# При **обучении с учителем** на вход подается набор тренировочных примеров, который обычно называют обучающим или тренировочным набором данных, и задача состоит в том, чтобы продолжить уже известные ответы на новый опыт, выраженный обычно в виде тестового или контрольного набора данных. Основное предположение здесь в том, что данные, доступные для обучения, будут чем-то похожи на данные, на которых потом придется применять обученную модель, иначе никакое обобщение будет невозможно.
#
# Для нашего абстрактого примера «научить компьютер читать» должна использоваться модель обучения с учителем. Данная модель строит деревья синтаксического разбора предложений (какие слова от каких зависят) по набору деревьев, построенных людьми для конкретных предложений.
#
# Предположение здесь в том, что деревья разбора строятся по одним и тем же законам, что модель, обученную на некотором наборе, можно будет применить и к новым предложениям, не входящим в обучающий набор.
#
# Если это предположение нарушится, модель работать не будет.
#
# Например, если лингвисты размечали предложения на английском языке, а потом применили обученную модель к немецкому, где буквы примерно те же, но синтаксис совершенно другой, ожидать от модели разумного поведения не стоит.

# %% [markdown] id="dnAHC1_fU7J_"
# Задачи **обучения с учителем** обычно делятся на задачи **классификации** и **регрессии**.
#

# %% [markdown] id="9A7W6un8Va0x"
# ### Сходства и отличия задач классификации, ранжирования и регрессии (обучение с учителем)

# %% [markdown] id="J85LkxUqvgmk"
#
# В задаче **классификации** нужно поданный на вход объект определить в один из классов, например, разделить фотографии животных на кошек, собак, лошадей и «все остальное», или по фотографии человеческого лица понять, кто из ваших друзей в социальной сети на ней изображен.
#
# Если продолжать пример с языком, то типичная задача классификации — это разметка слов по частям речи.
#
# А в задаче **регрессии** нужно предсказать значение некоей функции, у которой обычно может быть бесконечно много разных значений.
#
# Например, по росту человека предсказать его вес, сделать прогноз завтрашней погоды, предсказать цену акции или, скажем, выделить на фотографии прямоугольник, в котором находится человеческое лицо — сделать это необходимо, чтобы затем эти прямоугольники подать на вход упомянутому выше классификатору.
#
# Деление на **регрессию** и **классификацию**, конечно, очень условно, можно легко придумать «промежуточные» примеры (тот же разбор предложения — к какому
# классу отнести задачу «построить дерево»?).
#
# >Но обычно ясно, какую задачу мы решаем, и это деление имеет содержательный смысл: меняются целевые функции и, как следствие, процесс обучения.
#
#
#

# %% [markdown] id="SBDzZKd5WaB4"
# Еще одна задача в машинном обучении, которую можно легко спутать с регрессией, - это задача **ранжирования**. К ней относят поисковые и рекомендательные системы.
#
# Задача ранжирования ставится следующим образом: по имеющимся данным (в поисковой системе это будут тексты документов и прошлое поведение пользователей) отранжировать, т.е. расставить имеющиеся объекты в порядке убывания целевой функции (в поисковой системе она называется релевантностью).
#
# Эта задача чем-то похожа на задачу регрессии — нам так или иначе нужно предсказывать непрерывную целевую функцию, ту самую релевантность. Но при этом значений самой функции в данных совсем нет, да они нам и не важны. Имеют значение только результаты сравнения этой функции на разных объектах (какой документ будет выше другого в поисковой выдаче). Это приводит к ряду интересных и специфических методов обучения.

# %% [markdown] id="n2351M5Lf8SB"
# ## А если данные не размечены?

# %% [markdown] id="pNTh6WmXKMEY"
# ### Обучение без учителя.

# %% [markdown] id="soyKHrT7WayI"
# Если же размеченного набора данных, соответствующего конкретной задаче,
# нет, а есть просто данные, в которых надо «найти какой-нибудь смысл», то возникают задачи **обучения без учителя**.
#
# **Кластеризация**
#
# Типичнейший пример задачи обучения без учителя — это **кластеризация**: нужно разбить данные на заранее неизвестные классы по некоторой мере похожести так, чтобы точки, отнесенные к одному и тому же кластеру, были как можно ближе друг к другу, как можно более похожи, а точки из разных кластеров были бы как можно дальше друг от друга, как можно менее похожи.
#
# > Решив задачу кластеризации, можно выделить семейства генов из последовательностей нуклеотидов, или кластеризовать пользователей вашего веб-сайта и персонализовать его под каждый кластер, или сегментировать медицинский снимок, чтобы легко было понять, где же там опухоль.
#
# **Снижение размерности**
#
# Еще одна часто встречающаяся задача обучения без учителя — это **снижение
# размерности** (dimensionality reduction), когда входные данные имеют большую размерность, а задача состоит в том, чтобы построить представление данных меньшей размерности, которое тем не менее будет достаточно полно отражать исходные данные.
#
# Примером входных данных с большой размерностью можно считать разбитый на слова текст, размерность будет исчисляться десятками тысяч, а если на входе фотографии, то миллионами пикселей.
#
# Если мы получили из наших данных представления меньшей размерности, то  по ним всегда можно будет реконструировать исходные точки большей размерности. Это можно рассматривать как частный случай общей задачи выделения признаков, и мы будем подробно говорить об этом в теме про автокодировщики.
#
# **Оценка плотности**
#
# И наконец, третий и самый общий класс задач обучения без учителя — задача **оценки плотности**.
#
# Задача оценки плотности ставится следующим образом: пусть нам даны точки данных $ \{ x_1,... , x_N \} $ и, возможно, какие-то априорные представления о том, откуда взялись эти точки, и необходимо оценить распределение $p(x)$, из которого они получились.
#
# Это очень общая постановка задачи. Наиболее частое применение данного подхода встречается в задачах, где требуется исключить из обучающих выборок нерелевантные, аномальные примеры. И нейронные сети успешно с этим справляются.
#
# > Представьте, что у вас есть набор значений роста людей. Оценка плотности покажет, как часто встречаются разные значения роста. В обучающем примере рост человека 175 см. Мы понимаем, что это средний рост для мужчин в мире. Если в выборке будут встречаться примеры 140 и 219 см? Скорее всего это аномальные значения. Вероятность их нахождения в выборке - минимальна. Для корректной работы модели, их необходимо исключить из выборки.
#
# > Теперь представьте, что в выборке используются данные банковских транзакций или расстояния между атомами, как понять аномальны ли значения? Если вы специалист в конкретной предметной области, скорее всего, вы сможете определить. Но в большинстве случаев, лучше обратиться к машинному обучению, которое поможет нам избежать ошибок при подготовке данных для обучения моделей.
#

# %% [markdown] id="8jTuUZ49Uk8D"
# ### Ни рыба, ни мясо!

# %% [markdown] id="F0wlTP2qUmeH"
#
#
# Нередко в практике встречаются задачи, где возникает нечто среднее между обучением с учителем и обучением без учителя. Так обычно получается тогда, когда неразмеченные примеры найти очень легко, а размеченные получить сложно.
#
# Например, во все том же примере с синтаксическим разбором набрать сколько угодно неразмеченных текстов не представляет никакой сложности, а вот вручную нарисовать даже одно дерево нелегко.
#
# Или, скажем, задумайтесь о том, что такое «размеченные данные» для распознавания речи. Просто установить соответствие между звуковым файлом с речью и текстом, особенно если тексты достаточно длинные, здесь может быть недостаточно. По-настоящему размеченные данные для распознавания — это звуковые
# файлы, в которых вручную отмечены границы каждой фонемы, каждого звука человеческой речи. Это адский труд, обычно делегируемый волонтерам, студентам или младшим научным сотрудникам, но даже целая армия лингвистов-фонологов будет работать над датасетом крайне медленно.
#
# А неразмеченных звуков живой человеческой речи вы можете записать сколько угодно, просто включив диктофон на запись.
#
# Такую ситуацию иногда называют **обучение с частичным привлечением учителя**,
# или полуконтролируемым обучением (semi-supervised learning).
#
# Другой пример, промежуточного формата обучения — **обучением с подкреплением** (reinforcement learning).
#
# Обучение с подкреплением – это метод машинного обучения, в котором система (агент) обучается методом проб и ошибок. Идея заключается в том, что агент взаимодействует со средой, параллельно обучаясь, и получает вознаграждение за выполнение действий. Цель агента — получить как можно большую награду с течением времени, а для этого неплохо бы обучиться тем действиям, которые в конечном счете приводят к успеху.
#
# Обучение с подкреплением активно используется в робототехнике для промышленной автоматизации, при планировании бизнес-стратегий, в различных системах рекомендаций, в системах автопилотирования.

# %% [markdown] id="LXezXOfUa2G8"
# ## Особенности задач регрессии

# %% [markdown] id="EBYYaipLsXHP"
# В задачах регрессии наша модель выдаёт всегда одно числовое значение, в отличии от задачи классификации, где на выходе вероятности принадлежности к каждому классу. Выходное значение в регрессионной модели изначально не определено, значение диапазона может быть любым, а не только в диапазоне $[-1, 1]$.
#
# Все это приводит к тому, что ваша модель становиться очень чувствительна к входным данным сети, что сказывается и на ошибке предсказания.
#
# Однако, решая задачи регрессии, нейронщики прибегают к различным трюкам при подготовке данных, а именно к нормировке:
#
# * без нормирования данные могут быть в диапазоне от минус бесконечности до плюс бесконечности, те же самые зарплаты или уровень цен будут в диапазоне от 0 и до бесконечности. Для таких целей нейронщики используют активационные функции на выходном слое **linear** (любые данные) или **relu**(если данные больше 0).
#
# * при нормальном распределении с помощью **StandardScaler** диапазон данных после нормирования сложно предсказать, так как зависит от исходных данных, поэтому активационная функция только **linear**.
#
# * при min/max нормировании исходные данные приводятся к диапазону от 0 до 1 или от -1 до 1. Это может быть пример температуры на улице, результаты физических или химических экспериментов, рейтинги при учете лайков и дизлайков (положительный и отрицательный диапазоны). В этих случаях каждое значение делим на модуль самого большого числа. В этом случае мы можем использовать почти любые активационные функции, в соответствии с диапазоном нормирования.
#
# **ВАЖНО**. Выбор активационой функции является очень важным шагом при создании архитектуры НС, так как ошибка может привести к невозможности решить задачу.
#
#

# %% [markdown] id="WqryFnYU12MM"
# Перейдем к [практической части урока](https://colab.research.google.com/drive/1L4pI4giYvWY3T4gfqTF5c_XFkN9k4Nfz) и обсудим на примере [Резюме из ЕЦП «Работа в России»](https://opendata.trudvsem.ru/csv/cv.csv), как лучше нормировать данные, какую функцию ошибки использовать и как интерпретировать результаты.
